script: |
  super -f text -I q10256.spq | sort > q10256.out

inputs:
  - name: q10256.spq
    data: |
      SELECT ALL + col2 col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE col1 BETWEEN col2 AND + col2 * - CAST ( + 6 AS REAL ) * col1 + + 28 * + + col0 / - + col0 + + - 55 / - + 14;
  - name: tab0

outputs:
  - name: q10256.out
    data: |
